ki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u044c, \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043b\u0435\u0447\u0435\u0431\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 (\u043d\u044b\u043d\u0435&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D0%BF%D0%B8%D1%82%D0%B0%D0%BB%D1%8C_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%91%D1%83%D1%80%D0%B4%D0%B5%D0%BD%D0%BA%D0%BE\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u044c \u0438\u043c\u0435\u043d\u0438 \u0411\u0443\u0440\u0434\u0435\u043d\u043a\u043e\">\u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043a\u043b\u0438\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u044c \u0438\u043c\u0435\u043d\u0438 \u041d.&#160;\u041d.&#160;\u0411\u0443\u0440\u0434\u0435\u043d\u043a\u043e<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851\" class=\"mw-redirect\" title=\"1851\">1851<\/a>&#160;\u2014 \u041d\u0430 \u0443\u043b\u0438\u0446\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0430<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%BE%D1%80%D0%BE%D1%82_%D0%B2%D0%BE_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_2_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8F_1851_%D0%B3%D0%BE%D0%B4%D0%B0#4_.D0.B4.D0.B5.D0.BA.D0.B0.D0.B1.D1.80.D1.8F_1851_.D0.B3.D0.BE.D0.B4.D0.B0\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 2 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1851 \u0433\u043e\u0434\u0430\">\u0441\u0442\u0440\u0430\u0448\u043d\u0430\u044f \u0431\u043e\u0439\u043d\u044f<\/a>. \u041c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u043b\u044e\u0434\u0435\u0439, \u0447\u0430\u0441\u0442\u044c\u044e \u043d\u0435 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0432\u0448\u0438\u0445 \u043d\u0438\u043a\u0430\u043a\u043e\u0433\u043e \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430, \u0431\u044b\u043b\u0438 \u0443\u0431\u0438\u0442\u044b \u0438\u043b\u0438 \u0441\u0445\u0432\u0430\u0447\u0435\u043d\u044b \u0438 \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870\" class=\"mw-redirect\" title=\"1870\">1870<\/a> \u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%92%D0%B8%D0%BB%D1%8C%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0412\u0438\u043b\u044c\u0435\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0412\u0438\u043b\u044c\u0435<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/29_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"29 \u043d\u043e\u044f\u0431\u0440\u044f\">29 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c \u0438 \u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0431\u043e\u0440\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0445 \u0441\u0442\u043e\u0440\u043e\u043d \u043e\u0442\u043e\u0448\u043b\u0438 \u043d\u0430 \u043f\u0440\u0435\u0436\u043d\u0438\u0435 \u043f\u043e\u0437\u0438\u0446\u0438\u0438.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912\" class=\"mw-redirect\" title=\"1912\">1912<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D0%B1%D0%B8%D1%8F\" title=\"\u0421\u0435\u0440\u0431\u0438\u044f\">\u0421\u0435\u0440\u0431\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u044f\">\u0427\u0435\u0440\u043d\u043e\u0433\u043e\u0440\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_(1912%E2%80%941913)\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0430\u044f \u043c\u0438\u0440\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f (1912\u20141913)\">\u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0435\u0439<\/a>, \u043f\u0440\u0435\u0440\u0432\u0430\u0432 \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u0432\u0448\u0443\u044e\u0441\u044f 2 \u043c\u0435\u0441\u044f\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%B1%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0431\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0443\u044e \u0431\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924\" class=\"mw-redirect\" title=\"1924\">1924<\/a>&#160;\u2014 \u0410\u0440\u0435\u0441\u0442 \u0447\u043b\u0435\u043d\u043e\u0432 \u00ab\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931\" class=\"mw-redirect\" title=\"1931\">1931<\/a>&#160;\u2014 \u041f\u043e\u043b\u0438\u0442\u0431\u044e\u0440\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%9A_%D0%92%D0%9A%D0%9F(%D0%B1)\" class=\"mw-redirect\" title=\"\u0426\u041a \u0412\u041a\u041f(\u0431)\">\u0426\u041a \u0412\u041a\u041f(\u0431)<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e\u0431\u044b \u043d\u0430\u043a\u0430\u0437\u0430\u0442\u044c \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u043d\u044b\u0445 \u043b\u0438\u0446 \u0410\u043c\u0442\u043e\u0440\u0433\u0430, \u00ab\u0440\u0430\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u0448\u0438\u0445 25 \u0442\u044b\u0441. \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432 \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 \u0434\u0435\u0437\u0435\u0440\u0442\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0435\u0433\u043e \u0438\u0437 \u0421\u0421\u0421\u0420 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B9%D0%B7%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u042d\u0439\u0437\u0435\u043d\u0448\u0442\u0435\u0439\u043d, \u0421\u0435\u0440\u0433\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u044f \u042d\u0439\u0437\u0435\u043d\u0448\u0442\u0435\u0439\u043d\u0430<\/a>\u00bb. \u0420\u0435\u0447\u044c \u0438\u0434\u0435\u0442 \u043e \u0444\u0438\u043d\u0430\u043d\u0441\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0438 \u0444\u0438\u043b\u044c\u043c\u0430 \u043e \u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u042d\u0439\u0437\u0435\u043d\u0448\u0442\u0435\u0439\u043d \u0441\u043e\u0431\u0438\u0440\u0430\u043b\u0441\u044f \u0441\u043d\u0438\u043c\u0430\u0442\u044c \u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932\" class=\"mw-redirect\" title=\"1932\">1932<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u0434\u0435\u043a\u0440\u0435\u0442, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u044e\u0449\u0438\u0439 \u0432\u044b\u0434\u0430\u0447\u0443 \u043f\u0440\u043e\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043a\u0430\u0440\u0442\u043e\u0447\u0435\u043a \u0442\u0443\u043d\u0435\u044f\u0434\u0446\u0430\u043c \u0438 \u043f\u0430\u0440\u0430\u0437\u0438\u0442\u0430\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937\" class=\"mw-redirect\" title=\"1937\">1937<\/a>&#160;\u2014 \u041d\u0430 \u043f\u043b\u0435\u043d\u0443\u043c\u0435 \u0426\u041a \u0412\u041a\u041f(\u0431) \u0433\u043b\u0430\u0432\u0430 \u0